C5M Super Galaxy

Technology Documentary hosted by Mike Goral, published by Discovery Channel broadcasted as part of DC Mighty Planes series in 2012 - English narration


Information
------------------------------

In the super-charged season finale, MIGHTY PLANES boards &quot;C-5M Super Galaxy&quot; for a mission into a war zone, from the initial briefing to crossing the Atlantic, and through the perilous descent into Bagram, Afghanistan. Recently upgraded to &quot;Super Galaxy&quot; status, this heavy-lifting aircraft can fly non-stop to virtually anywhere in the world, delivering cargo too large and too urgent to be shipped any other way. Follow along with the U.S. Air Force onboard this mighty plane on a marathon mission to Bagram, Afghanistan, a 14-hour, 6,200-mile journey requiring dangerous mid-air refueling and a perilous landing in the heart of enemy territory.



